import React, { useState } from 'react';
import { TextField, Button, Box } from '@mui/material';
import '../CSS/SignInPage.css'; // Import custom CSS
import AnimatedWrapper from '../components/AnimatedWrapper'; // Your animation wrapper component

const SignInPage = () => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Logging in with:', { username, password });
  };

  return (
    <div className="wrapper">
      {/* Animated background */}
      <div className="animated-wrapper">
        <AnimatedWrapper />
      </div>

      {/* Sign In Form */}
      <Box className="form-wrapper">
        <h1>Sign In</h1>
        <form onSubmit={handleSubmit}>
          {/* Username Field */}
          <Box className="control">
            <div className="block-cube">
              <TextField
                label="Username"
                variant="outlined"
                fullWidth
                name="username"
                type="text"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
                InputProps={{
                  style: {
                    backgroundColor: 'transparent',
                    color: '#333', // Ensure text color is visible
                  },
                }}
                InputLabelProps={{
                  style: { color: '#ffb3d9' }, // Ensure label text is pink
                }}
              />
            </div>
          </Box>

          {/* Password Field */}
          <Box className="control">
            <div className="block-cube">
              <TextField
                label="Password"
                variant="outlined"
                fullWidth
                name="password"
                type="password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                InputProps={{
                  style: {
                    backgroundColor: 'transparent',
                    color: '#333', // Ensure text color is visible
                  },
                }}
                InputLabelProps={{
                  style: { color: '#ffb3d9' }, // Ensure label text is pink
                }}
              />
            </div>
          </Box>

          {/* Submit Button */}
          <Button className="btn" type="submit" fullWidth>Sign In</Button>
        </form>
      </Box>
    </div>
  );
};

export default SignInPage;
